{{Infobox dungeon |name = Moor of Icirrus |image = [[File:Moor of Icirrus.png|300px]] |caption = A map of Moor of Icirrus. |tokens = 356,500 |location = Unova Route 8 }} '''Moor of Icirrus''' is a [[Dungeons|dungeon]] in [[Unova]]. It initially has 81 tiles arranged in an 9x9 square, including 9 chest tiles, 21 non-boss encounter tiles, and 1 boss encounter tile.
